public static void nodeMessage(String message) {
  long now = System.nanoTime();
  System.out.println(String.format(Locale.ROOT,
                                   "%5.3fs %5.1fs:           [%11s] %s",
                                   (now-globalStartNS)/1000000000.,
                                   (now-localStartNS)/1000000000.,
                                   Thread.currentThread().getName(),
                                   message));

}

